script: |
  super -f tsv -I q4168.sql | sort > q4168.out

vector: true

inputs:
  - name: q4168.sql
    data: |
      SELECT ALL - col0 / 62 + + col1 / - col0 FROM tab1 cor0 WHERE NOT 39 IS NULL GROUP BY col0, col1 HAVING NOT - CAST ( CAST ( NULL AS INTEGER ) AS REAL ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q4168.out
    data: |
      -1
      -2
      0
